import { useRef } from 'react';
import classes from './SearchResultsList.module.css';

function SearchResultsList(props){

    const resultsListRef = useRef();

    const handleSelectRecipe = (event) => {
        props.onHandleFocusOut(resultsListRef.current.id)
    }

    return (
        <div ref={resultsListRef} onClick={handleSelectRecipe} id='results-list' className={classes['results-list']}>
            {props.filteredQueries.map((word, i) => (
                <div key={i} onClick={handleSelectRecipe} className={classes.results}>{word}</div>
            ))}
        </div>
    );
}

export default SearchResultsList;
